import React, { Fragment } from 'react';
import AppMap from './Appmap';

const Appass = (props) => {
  //console.log(props.TodoPass);
    return (
        <Fragment>
          <h1>I am from props. ismail</h1>
          {
                         props.TodoPass.map((todo) => (
                             <AppMap 
                             key={todo.id} 
                             todoapp={todo.todo} 
                      
                             />
                         ))}
        </Fragment>
    );
};
export default Appass;
